import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";
import MyComponent from './MyComponent'

function App() {
  return (
    <div className="App">
     <BrowserRouter>

  <Switch>
    {/* <Route path="/user">
      <User />
    </Route> */}
    <Route path="/" exact>
      <MyComponent />
    </Route>
  </Switch>
</BrowserRouter>
    </div>
  );
}

export default App;
